import React, { Component } from 'react';
import { connect } from 'react-redux'
import { holdTempCourse } from './../../../action/tempActions';

class GradeEntryClassNavBar extends Component {
    
    selected(course) {
        this.props.holdTempCourse(course)
    }
    
    render() {

        const courses = this.props.courseList && this.props.courseList.map(course => {
            console.log(course)
            return (
                <button key={course.id} id={course.id} type="button" 
                className={"btn btn-secondary mr-1"} 
                onClick={() => this.selected(course)}>
                    {course.name}
                </button>
            )
        })
        //Code to return a navbar with a list of all the teachers classes
        return (
            <div className="pt-2">
                <div class="btn-toolbar" role="toolbar">
                    <div className="btn-group">
                        {courses}
                    </div>
                </div>
            </div>
        );
    }
}

const mapStateToProps = state => ({
    user: state.user.user,
    courseList: state.user.user.courseList
})

export default connect(mapStateToProps, { holdTempCourse })(GradeEntryClassNavBar);
